import './App.css';
import HomePage from './components/HomePage.js';
import Header from './components/Header';

function App() {
  <link href="https://fonts.googleapis.com/css2?family=Yeseva+One&display=swap" rel="stylesheet"/>
  return (
    <div className="App">
      <Header />
      <HomePage />
    </div>
  );
}

export default App;
